ride_length = difftime(stop_time, start_time))\n","\n","# Convert ride_length from factor to numeric to run calculations on the data\n","is.factor(bike_trip_dfftm$ride_length)\n","bike_trip_dfftm <- bike_trip_dfftm %>% \n","  mutate(ride_length = as.numeric(as.character(ride_length)))\n","is.numeric (bike_trip_dfftm$ride_length)\n","\n","# Remove insignificant rows with ride length less than 0\n","bike_trip_clean <- bike_trip_dfftm[!(bike_trip_dfftm$ride_length < 0),]"]},{"cell_type":"markdown","id":"f931b175","metadata":{"papermill":{"duration":0.013165,"end_time":"2022-06-27T13:43:54.741506","exception":false,"start_time":"2022-06-27T13:43:54.728341","status":"completed"},"tags":[]},"source":["#### I will export the cleaned data for use in PowerBI"]},{"cell_type":"markdown","id":"89d330f1","metadata":{"papermill":{"duration":0.012918,"end_time":"2022-06-27T13:43:54.767343","exception":false,"start_time":"2022-06-27T13:43:54.754425","status":"completed"},"tags":[]},"source":["## ANALYZE PHASE"]},{"cell_type":"code","execution_count":4,"id":"a4af8113","metadata":{"execution":{"iopub.execute_input":"2022-06-27T13:43:54.797408Z","iopub.status.busy":"2022-06-27T13:43:54.795859Z","iopub.status.idle":"2022-06-27T13:44:19.494782Z","shell.execute_reply":"2022-06-27T13:44:19.492584Z"},"papermill":{"duration":24.71797,"end_time":"2022-06-27T13:44:19.498477","exception":false,"start_time":"2022-06-27T13:43:54.780507","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["1292.60198882234"],"text/latex":["1292.60198882234"],"text/markdown":["1292.60198882234"],"text/plain":["[1] 1292.602"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["703"],"text/latex":["703"],"text/markdown":["703"],"text/plain":["[1] 703"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["3356649"],"text/latex":["3356649"],"text/markdown":["3356649"],"text/plain":["[1] 3356649"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["0"],"text/