ay\", y = \"Average Trip Duration\", fill = \"User Type\") +\n","  theme(panel.background = element_rect(fill = \"white\", color = \"white\"),\n","        axis.ticks = element_blank(), axis.title = element_blank(),\n","        axis.text.y = element_blank(), axis.text.x = element_text(color = \"black\", size = 15)) +\n","  annotate(\"text\", x = .75, y = 2344, label = \"2,244s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 1.2, y = 1021, label = \"921s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 1.75, y = 1989, label = \"1,889s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 2.2, y = 878, label = \"778s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 2.75, y = 1746, label = \"1,646s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 3.2, y = 851, label = \"751s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 3.75, y = 1766, label = \"1,666s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 4.2, y = 855, label = \"755s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 4.75, y = 1773, label = \"1,673s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 5.2, y = 854, label = \"754s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 5.75, y = 1906, label = \"1,806s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 6.2, y = 888, label = \"788s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 6.75, y = 2157, label = \"2,057s\", color = \"black\", fontface = \"bold\", size = 4) +\n","  annotate(\"text\", x = 7.2, y = 1000, label = \"900s\", color = \"black\", fontface = \"bold\", size = 4)\n","\n","# "]},{"cell_type":"markdown","id":"3dff3008","metadata":{"papermill":{"duration":0.020084,"end_time":"2022-06-27T13:44:51.081499","exception":false,"start_time":"2022-06-27T13:44:51.061415","status":"completed"},"tags":[]},"source":["#### -> Although both members and casual riders have longest trip duration on Sundays and lowest on Tuesdays, casual riders have longer trip duration than members through out the week."]},{"cell_type":"markdown","id":"4a791cb0","metadata":{"papermill":{"duration":0.019608,"end_time":"2022-06-27T13:44:51.121789","exception":false,"start_time":"2022-06-27T13:44:51.102181","status":"completed"},"tags":[]},"source":["## Conclusion\n","#### By looking at the previous 12 months of Cyclistic trip data, we're able to find out that :\n","* #### There are more annual members compared to casual riders\n","* #### Like casual riders, annual members use more of classic bike compared to electric bike, only that non of its riders use the docked bike\n","* #### Casual riders outnumber annual members on weekends (Saturdays & Sundays) while annual members are seen to be very active during week days\n","* #### Casual and member riders are seen to be more active between June and October with peak in July and September respectively\n","* #### Although both members and casual riders have longest trip duration during weekends and lowest on week days, casual riders have (approximately 2 times) longer trip duration than members through out the week"]},{"cell_type":"markdown","id":"e8ab2753","metadata":{"papermill":{"duration":0.019733,"end_time":"2022-06-27T13:44:51.161046","exception":false,"start_time":"2022-06-27T13:44:51.141313","status":"completed"},"tags":[]},"source":["## Recommendation\n","* #### Launch a campaign targetting casual riders that use the service similar to annual members during the peak period\n","* #### Remind casual riders of annual membership benefits\n","* #### Encourage casual riders to convert into annual members by offering incentives to those becoming annual members \n","* #### Introduce a weekend membership plan that casual riders who love to ride on weekends can suscribe to annually.  "]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":405.993808,"end_time":"2022-06-27T13:44:51.907105","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-27T13:38:05.913297","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}